    return(
    <div>
    <Propchildren age="21">abc</Propchildren>
    <Propchildren age="23">def</Propchildren>
    <Propchildren age="25">ghi</Propchildren>
    <Propchildren age="25" name="xyz"/>

    </div>
  );
  }
}
export default Propparent
